import React, { Component } from 'react';
import { Bar, Pie } from 'react-chartjs-2';

class Chart extends Component {
    constructor(props){
        super(props);
        this.state={
            chartData:{
                labels: ['Virginia', 'Ohio', 'N. California', 'Oregon', 'Mumbai', 'Osaka-Local', 'Seoul', 'Singapore', 'Sydney', 'Tokyo', 'Canada', 'Frankfurt', 'Ireland', 'London', 'Paris', 'Sao Paulo'],
                datasets:[
                    {
                        label: 'Number of users',
                        data: [
                            423678,
                            266151,
                            913645,
                            167428,
                            72615,
                            876334,
                            334958,
                            698672,
                            423536,
                            34847,
                            827748,
                            313467,
                            748745,
                            358345,
                            152661,
                        ],
                        backgroundColor: [
                            'rgba(255, 99, 132, 0.6)',
                            'rgba(54, 162, 235, 0.6)',
                            'rgba(255, 206, 86, 0.6)',
                            'rgba(75, 192, 192, 0.6)',
                            'rgba(153, 102, 255, 0.6)',
                            'rgba(255, 159, 64, 0.6)',
                            'rgba(255, 99, 132, 0.6)',
                            'rgba(255, 206, 86, 0.6)',
                            'rgba(255, 99, 132, 0.6)',
                            'rgba(54, 162, 235, 0.6)',
                            'rgba(75, 192, 192, 0.6)',
                            'rgba(153, 102, 255, 0.6)',
                            'rgba(255, 159, 64, 0.6)',
                            'rgba(255, 99, 132, 0.6)',
                            'rgba(54, 162, 235, 0.6)',
                            'rgba(75, 192, 192, 0.6)',
                        ]
                    }
                ]
            }


        }
    }

    render(){
        return(
                <div className="chart">
                    <Bar 
                    data={this.state.chartData}
                    legendPosition="bottom"
                    />
                    <Pie 
                    data={this.state.pieData}
                    />
                </div>
        )
    }
}

export default Chart;
